import PropTypes from "prop-types";
import * as React from 'react';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import Divider from '@mui/material/Divider';
import ListItemText from '@mui/material/ListItemText';
import ListItemAvatar from '@mui/material/ListItemAvatar';
import Avatar from '@mui/material/Avatar';
import Typography from '@mui/material/Typography';
import MyCardStats from "components/MyCards/MyCardStats.js";
import usflag from "../../assets/img/united-states-2.png";
// components

export default function MyInvestmentCard({ color = "light" }) {
    return (
        <>
            <div
                className={
                    "relative flex flex-col min-w-0 break-words w-full mb-6 shadow-lg rounded " +
                    (color === "light" ? "bg-white" : "bg-lightBlue-900 text-white")
                }
            >
                <div className="rounded-t mb-0 px-4 py-3 border-0">
                    <div className="flex flex-wrap items-center">
                        <div className="relative w-full px-4 max-w-full flex-grow flex-1">
                            <h3
                                className={
                                    "font-semibold text-lg " +
                                    (color === "light" ? "text-blueGray-700" : "text-white")
                                }
                            >
                                4e napisat
                            </h3>
                        </div>
                    </div>
                </div>
                <div className="block w-full overflow-x-auto">
                    <section className="pb-20 bg-blueGray-200 -mt-70">
                        <div className="w-full lg:w-6/12 px-4 py-5">
                            <MyCardStats
                                statSubtitle="S&P 500"
                                statTitle="4,423.25 USD"
                                statArrow="up"
                                statPercent="2.44"
                                statPercentColor="text-emerald-500"
                                statDescripiron="Since last month"
                                statIcon={usflag}
                            />
                        </div>
                    </section>
                </div>
            </div>
        </>
    )
}
